import React, { useEffect } from "react";
import Layout from "../component/Layout";
import { useRouter } from "next/router";
import axios from "axios";
import Link from "next/link";

const Search = (props) => {
  const router = useRouter();
  useEffect(() => {
    axios
      .get(
        "http://hanstream.gabia.io/searchSimpleList",
        {
          params: {
            num: router.query.id,
          },
        },
        { withCredentials: true }
      )
      .then((response) => {
        console.log(response);
        console.log(router.query.id);
        // props.history.replace("/");
        //console.log(props.history);
        /* this.dbName = response.data[0].name;
        this.dbContentsName = response.data[0].title;*/
        console.log(response.data);
        //console.log(this.dbName);
        //this.getSimpleResult(this.dbName);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  console.log(props.data);
  return (
    <Layout>
      당신이 검색한 키워드는 "{router.query.id}" 입니다.
      <br />
      {props.data[0].title}
    </Layout>
  );
};
Search.getInitialProps = async function () {
  const res = await axios.get(
    "http://hanstream.gabia.io/searchSimpleList?num=1 "
  );
  const data = await res.data;

  console.log(`Show data fetched. Count: ${data.length}`);
  return {
    data: data,
  };
};
export default Search;
